def solve(n):
    prime_sum = 0
    for num in range(2, n+1):
        prime = True
        for i in range(2, num):
            if num % i == 0:
                prime = False
                break
        if prime:
            prime_sum += num
    return prime_sum

def solve(n):
    sum = 0 
    for num in range(2, n+1):
        if num > 1:
            for i in range(2, num):
                if (num % i) == 0:
                    break
            else:
                sum += num
    return sum

